import SideBarStyle from '../Style/SideBar.module.css'

const SideBar = () => {
    return (
        <div className={SideBarStyle.SideBarMain}>
            <button className={`${SideBarStyle.btn} ${SideBarStyle.btnTop}`} type='button'></button>

            {/* <div className={`${SideBarStyle.item} ${SideBarStyle.itemCheck}`}><p>Cappuccino</p></div> */}

            <div className={SideBarStyle.item} Checked><p>Cappuccino</p></div>
            <div className={SideBarStyle.item}><p>Latte</p></div>
            <div className={SideBarStyle.item}><p>Americano</p></div>
            <div className={SideBarStyle.item}><p>Expresso</p></div>
            <div className={SideBarStyle.item}><p>Flat White</p></div>


            <button className={`${SideBarStyle.btn} ${SideBarStyle.btnBottom}`} type='button'></button>
        </div>
    )
}
export default SideBar;
